const tasks = [
  { id: 1, name: 'Task One' },
  { id: 2, name: 'Task Two' },
  { id: 3, name: 'Task Three' },
];

export default function Task() {
    return (<div>{tasks.map((item) => (
        <div key={item.id}>{item.name}</div>
    ))}</div>)
}
